/*Table structure for table `px_goods_order_out` */

DROP TABLE IF EXISTS `px_goods_order_out`;

CREATE TABLE `px_goods_order_out` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '流水号',
  `order_no` varchar(32) DEFAULT NULL COMMENT '订单编号',
  `user_id` varchar(32) DEFAULT NULL COMMENT '会员ID',
  `goods_id` varchar(32) DEFAULT NULL COMMENT '商品ID',
  `shop_id` varchar(32) DEFAULT NULL COMMENT '店铺ID',
  `shop_name` varchar(32) DEFAULT NULL COMMENT '店铺名称',
  `goods_title` varchar(32) DEFAULT NULL COMMENT '商品名称',
  `pay_type` varchar(32) DEFAULT NULL COMMENT '付款方式',
  `order_status` varchar(32) DEFAULT NULL COMMENT '订单状态',
  `goods_price` varchar(32) DEFAULT NULL COMMENT '商品价格',
  `seller_amount` varchar(32) DEFAULT NULL COMMENT '订单数量',
  `goods_comm_price` varchar(32) DEFAULT NULL COMMENT '商品原始价格',
  `goods_type` varchar(32) DEFAULT NULL COMMENT '商品类型',
  `gmt_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=790 DEFAULT CHARSET=gbk;

